import { makeStyles } from "@mui/styles"

const homeStyles = makeStyles (() =>({
    card:{
        maxWidth: 345,
        background: '#131e2f',
        color: '#ffffff',
        borderRadius:'12%',
    },
    title:{
        marginLeft: '110px',
    },
    }
))

export default homeStyles
